import {IonPhaser} from "@ion-phaser/react";
import React from "react";
import Phaser from "phaser";


const PhaserMain = () => {

    const gameState = {
        initialize: true,
        game: {
            width: 960,
            height: 600,
            type: Phaser.AUTO,
            scene: {
                preload: preload,
                create: create,
                update: update,
            },
            physics: {
                default: 'arcade',
                arcade: {
                    gravity: {y: 300},
                    debug: false
                }
            },
        },
    }

    function preload() {
        this.load.image('environment', 'assets/environment_forest.png');
    }
    function create() {
        this.add.image(480, 220, 'environment');
        let grid = this.add.grid(0, 500, 800, 400, 50, 50,  0x057605);

    }
    function update() {
    }
    return (
        <>
            <IonPhaser game={gameState.game} initialize={gameState.initialize}/>
        </>
    );
}
export default PhaserMain;
